			"当这世界已经准备将我遗弃\r\n像一个伤兵被留在孤独荒野里\r\n开始怀疑我存在有没有意义\r\n在别人眼里我似乎变成了隐形\r\n难道失败就永远翻不了身\r\n谁来挽救堕落的灵魂\r\n每次一见到你 心理好平静\r\n就像一只蝴蝶飞过废墟\r\n我又能活下去 我又找回勇气\r\n你的爱像氧气帮忙我呼吸\r\n我又能呼吸 我又能呼吸\r\n你就是不愿意放弃\r\n生命充满乱七八糟的问题\r\n像走在没有出口的那个迷宫里\r\noh no 一次又一次只会用借口逃避\r\n怎么你从来没对我彻底的死心\r\n我有何德何能值得你珍惜\r\n为何你对我有求必应\r\n每次一想到你 像雨过天晴\r\n看见一只蝴蝶飞过废墟\r\n是那么的美丽 就像一个奇迹\r\n让我从倒下的地方站起\r\nWoo....只要一靠近你\r\n就觉得安心\r\n你看着我的眼没有怀疑\r\n你对我的相信\r\n让我又能重生\r\n不管世界多冷我还有你\r\n我有你\r\n爱我这样的人对你来说不容易\r\n我的痛苦你也经历\r\n你是唯一 陪我到天堂与地狱\r\n每次一想到你\r\n像雨过天晴 看见一只蝴蝶飞过了废墟\r\n我能撑得下去 我会忘了过去\r\n是你让我找回新的生命\r\nyeah.. 每次一见到你 就心存感激\r\n现在我能坦然面对自己\r\n我会永远珍惜 我会永远爱你\r\n在我心底的你的位置没有人能代替\r\nyeah 你就是那唯一\r\n\n﹎﹎﹎﹎﹎﹎﹎﹎﹎﹎﹎﹎﹎﹎\r\nLyrics Append By MXiTunes\r\nAppend Time 2011-03-16 20:40:54\r\n﹊﹊﹊﹊﹊﹊﹊﹊﹊﹊﹊﹊﹊﹊"
