			"[ti:牙关]\r\n[ar:五月天]\r\n[al:知足 最真杰作选]\r\n[by:253057646]\r\n\r\n[00:00.18]五月天 - 牙关\r\n[04:22.98][03:45.87][03:01.89][02:25.34][02:13.05][01:28.33][01:03.27][00:50.81][00:18.35][00:11.05][00:07.23]\r\n[00:08.50]词：阿信  曲：怪兽\r\n[04:32.60][00:13.07]紫.ｓè制作  QQ：253057646\r\n[00:25.44]放肆的尽情挥霍 那一年玩的多疯\r\n[00:30.88]你和我站上全世界的最快乐的巅峰\r\n[00:37.82]等着雨停的午后 你希望此刻永久\r\n[00:43.73]而现在 永久就是永久的牢笼\r\n[00:49.46]让我一直在等候\r\n[02:13.94][00:51.65]等待後面是等待 更沉默的等待\r\n[03:17.43][02:20.57][00:58.50]然後咬紧了牙关 等待更多的等待\r\n[03:48.51][03:22.85][02:25.97][01:03.92]如果你 爱过我 你不会就这样走\r\n[03:54.39][03:29.09][02:32.29][01:10.23]就这样 丢下我 和那些天真承诺\r\n[04:00.75][03:35.43][02:38.62][01:16.52]如果我 再也不 不能再更多的承受\r\n[04:07.68][03:42.43][02:45.52][01:23.39]痛哭之後 却又咬紧牙关\r\n[01:47.43]你最爱哪个歌手 最爱吃什麽火锅\r\n[01:53.23]最爱把小小的脸 轻轻的靠在我胸口\r\n[02:00.05]这城市每个角落 回忆都霸占街头\r\n[02:05.71]我知道 你会想起雨停的时候\r\n[02:11.14]我知道你会回头\r\n[04:11.82][02:49.80]继续漂流\r\n[04:18.29]继续等候\r\n\r\n"
